import React from 'react';
import './Header.css'; 
import logo from '../../Assets/logo.png';


const Header = () => {
  return (
    <header className="header">
      
      <div className="logo">
      <img src="https://svgsilh.com/svg/36103.svghttps://thenounproject.com/api/private/icons/5700947/edit/?backgroundShape=SQUARE&backgroundShapeColor=%23000000&backgroundShapeOpacity=0&exportSize=752&flipX=false&flipY=false&foregroundColor=%23000000&foregroundOpacity=1&imageFormat=png&rotation=0" alt="Icon" style={{ maxWidth: '100%', maxHeight: '100%' }}/>
      </div>

      <div className="menu">
        <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact Us</li>
            <li>Sign In</li>
          </ul>
        </nav>
      </div>
      
    </header>
  );
};

export default Header;
